import React from 'react';
import {Card, Button, Avatar} from 'antd';

function UserInfo() {
    return (
        <div>
            <Card actions={[
                <div key="twit"><br/>dd</div>,
                <div key="follow"><br/>dd</div>,
                <div key=""><br/>dd</div>,
            ]}>
                <Card.Meta avatar={<Avatar>hello</Avatar>} title="gigle"/>
            </Card>
            <Button>로그아웃</Button>
        </div>
    )
}

export default UserInfo
